<html lang="ru">

<head>
    <meta charset="UTF-8">
    <style>
        body {
            font-family: Arial, sans-serif;
            font-size: 12px;
            margin: 0;
            padding: 0;
            overflow-x: hidden;
            /* Предотвращает горизонтальную прокрутку */
        }

        .table {
            width: 100%;
            border-collapse: collapse;
            table-layout: fixed;
            /* Автоматическая ширина для ячеек */
        }

        .table th,
        .table td {
            border: 1px solid #000;
            padding: 5px;
            text-align: center;
            vertical-align: middle;
            word-wrap: break-word;
            /* Перенос слов */
            overflow: hidden;
            /* Скрывает переполнение */
            max-width: 150px;
            /* Максимальная ширина ячеек */
        }

        .logo-cell {
            text-align: center;
            vertical-align: middle;
            width: 15%;
        }

        .header-cell {
            text-align: center;
            font-weight: bold;
            font-size: 14px;
            padding: 10px;
        }

        .details-cell {
            text-align: left;
            padding-left: 5px;
        }

        .no-border {
            border: none;
        }

        .image-cell img {
            width: 100%;
            height: auto;
        }
    </style>
</head>

<body>
    <table class="table">
        <!-- Header Row -->
        <tbody>
            <tr>
                <td class="logo-cell" rowspan="4">
                    <img src="data:image/jpeg;base64," alt="Logo" style="width: 100px;">
                </td>
                <td colspan="6" class="header-cell" rowspan="1">Международная логистическая компания JOYCITY 313</td>
                <td class="image-cell" rowspan="4">
                    <img src="data:image/png;base64," alt="Image1" style="width: auto; max-height:100px">
                    <img src="data:image/png;base64," alt="Image1" style="width: auto; max-height:100px">
                </td>
            </tr>
            <!-- Details Rows -->
            <tr>
                <td>Отправитель</td>
                <td>Номер телефона</td>
                <td>Город отправления</td>
                <td>Название</td>
                <td>Дата изготовления</td>
                <td>11.09.2024</td>
            </tr>
            <tr>
                <td>Получатель</td>
                <td>Номер получателя</td>
                <td>Город получения</td>
                <td>Город</td>
                <td>Вид перевозки</td>
                <td>20-30</td>
            </tr>
            <tr>
                <td class="details-cell"></td>
                <td class="details-cell" colspan="2">Номер заказа</td>
                <td class="details-cell" colspan="2">JoyCity313-HMR 579-1378-7</td>
                <td class="details-cell"></td>
            </tr>
            <!-- Title Row -->
            <tr>
                <td colspan="8" class="header-cell">Накладная</td>
            </tr>
            <!-- Table Content -->
            <tr colspan="8">
                <td class="details-cell">Номер грузов</td>
                <td colspan="2" class="details-cell">JoyCity313-HMR 579-1378-7</td>
                <td class="details-cell">Итого количество(шт)</td>
                <td colspan="2" class="details-cell">хоз-товар</td>
                <td class="details-cell"></td>
                <td class="details-cell"></td>
            </tr>
            <tr>
                <td class="details-cell">Единичная цена на таможенную пошлину($/пара)</td>
                <td class="details-cell">Объём (м³)</td>
                <td class="details-cell">1,897</td>
                <td class="details-cell">Вес (Kg)</td>
                <td colspan="2" class="details-cell">141,5</td>
                <td class="details-cell"></td>
                <td class="details-cell"></td>
            </tr>
            <tr>
                <td class="details-cell">Сумма страхования (¥)</td>
                <td class="details-cell">Страховая ставка</td>
                <td class="details-cell">0,01</td>
                <td class="details-cell">Расходы на страхование ($)</td>
                <td colspan="2" class="details-cell">19,00</td>
                <td class="details-cell"></td>
                <td class="details-cell"></td>
            </tr>
            <tr>
                <td class="details-cell">Авансирование на территории Китая ($)</td>
                <td class="details-cell">Расходы на упаковку ($)</td>
                <td class="details-cell">14,00</td>
                <td class="details-cell">Итого</td>
                <td colspan="2" class="details-cell">507,03</td>
                <td class="details-cell"></td>
                <td class="details-cell"></td>
            </tr>
            <!-- Footer Rows -->
            <tr>
                <td colspan="8" class="header-cell" style="text-align:start">Исполнитель:</td>
            </tr>
            <tr>
                <td colspan="8" class="header-cell" style="text-align:start">Утверждено:</td>
            </tr>
        </tbody>
    </table>


</body>

</html>